// .storybook/preview.js

export const parameters = {
  backgrounds: {
    default: "twitter",
    values: [
      {
        name: "twitter",
        value: "#00aced",
      },
      {
        name: "facebook",
        value: "#3b5998",
      },
    ],
  },
};
